function [Shorty, Longy] = PSucker(List1, List2)
%Function will take in the lists of syllable features in List1 and List2,
%and calulcate the distance between each row in List1 and every row in
%List2.  The features in the input vars should be (Mx33)and have already
%been scaled by ScaleFeats.

%Test input array for formatting
[m, n] = size(List1);
[o, p] = size(List2);

if n ~=33
    error('List1 not appropriately formatted.  Must be Mx33.')
end

if p ~=33
    error('List2 not appropriately formatted.  Must be Ox33.')
end

%Pre-allocate the needed variables
Shorty = zeros(m,o);
Longy = zeros(m,o);



%Call HowFar to populate the PVal Matrices
for i=1:m
    for j=1:o
        %[Dshort, Longy(i,j)] = HowFar(List1(i,:), List2(j,:));
        [Dshort, Dlong] = HowFar(List1(i,:), List2(j,:));
        Longy(i,j) = Long_LookUpP(Dlong);
        Shorty(i,j) = Short_LookUpP(Dshort);
    end
end

end

function P=Long_LookUpP(Dval)
%Load P-value lookup table for each distance measure
Long_Pval = Long_PFunct();

%Catch to see if given value exceeds extent of Pval
if Dval>max(Long_Pval(:,1))
    P=1;
else
    ind = find(Long_Pval(:,1)>=Dval, 1, 'first');
    %Get P-value as mean of the Indexed PO-val and the previous one
    P = Long_Pval(ind,2);
end

[r,s] = size(P);
if r~=1 || s~=1
    a=1
end

end


