function P=Short_LookUpP(Dshort)
%Load P-value lookup table for each distance measure
Pmat=-1*ones(4,4);
Short_Pval = Short_PFunct();

%Populate the P-matrix with values
for i=1:4
    for j=1:4
        if Dshort(i,j) > max(Short_Pval)
            Pmat(i,j) = 1;
        else
            ind = find(Short_Pval(:,1)>=Dshort(i,j), 1, 'first');
            %Get P-value as mean of the Indexed PO-val and the previous one
            Pmat(i,j) = Short_Pval(ind,2);
        end
    end
end

%Find best-match path through the P-matrix
P = mean([Pmat(1,1),Pmat(2,2),Pmat(3,3),Pmat(4,4)]);

end

